"use strict";(self.webpackChunkkarajan_610_github_io=self.webpackChunkkarajan_610_github_io||[]).push([[838],{4351:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2024/05/09/index","metadata":{"permalink":"/blog/2024/05/09/index","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-05-09/index.mdx","source":"@site/blog/2024-05-09/index.mdx","title":"\uccab \ube14\ub85c\uadf8 \ud3ec\uc2a4\ud2b8\ub97c \uc791\uc131\ud558\uba70...","description":"Docusaurus\ub97c \uc0ac\uc6a9\ud558\uc5ec \ube14\ub85c\uadf8\ub97c \uc791\uc131\ud558\uac8c \ub418\uc5c8\ub2e4. \uc601\uac10\uc740 redux-toolkit\uacf5\uc2dd \uc0ac\uc774\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\uac8c \ub418\uc5c8\uace0, \ub098\ub984 \uc0ac\uc6a9\ud574\ubcf4\ub2c8 \uad1c\ucc2e\uc544\uc11c \uc0ac\uc6a9\ud558\uac8c \ub418\uc5c8\ub2e4. \ubcf8\ub798 \ube14\ub85c\uadf8\ub97c \uc798 \uc0ac\uc6a9\uc744 \uc548\ud558\ub824\uace0 \ud558\uc600\uc9c0\ub9cc \ub530\ub85c private\uc774\uc678\uc5d0 public \uc73c\ub85c \uba38\ub9bf\uc18d\uc744 \uc815\ub9ac\ud558\uace0 \uc2f6\uc740 \uc0dd\uac01\uc774 \ub4e4\uc5b4\uc11c \uc2dc\uc791\ud558\uac8c \ub418\uc5c8\ub2e4.","date":"2024-05-09T00:00:00.000Z","tags":[{"label":"hello","permalink":"/blog/tags/hello"}],"readingTime":4.665,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"\uccab \ube14\ub85c\uadf8 \ud3ec\uc2a4\ud2b8\ub97c \uc791\uc131\ud558\uba70...","tags":["hello"]},"unlisted":false},"content":"Docusaurus\ub97c \uc0ac\uc6a9\ud558\uc5ec \ube14\ub85c\uadf8\ub97c \uc791\uc131\ud558\uac8c \ub418\uc5c8\ub2e4. \uc601\uac10\uc740 redux-toolkit\uacf5\uc2dd \uc0ac\uc774\ud2b8\uc5d0\uc11c \uc0ac\uc6a9\ud558\uac8c \ub418\uc5c8\uace0, \ub098\ub984 \uc0ac\uc6a9\ud574\ubcf4\ub2c8 \uad1c\ucc2e\uc544\uc11c \uc0ac\uc6a9\ud558\uac8c \ub418\uc5c8\ub2e4. \ubcf8\ub798 \ube14\ub85c\uadf8\ub97c \uc798 \uc0ac\uc6a9\uc744 \uc548\ud558\ub824\uace0 \ud558\uc600\uc9c0\ub9cc \ub530\ub85c private\uc774\uc678\uc5d0 public \uc73c\ub85c \uba38\ub9bf\uc18d\uc744 \uc815\ub9ac\ud558\uace0 \uc2f6\uc740 \uc0dd\uac01\uc774 \ub4e4\uc5b4\uc11c \uc2dc\uc791\ud558\uac8c \ub418\uc5c8\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \uc9c0\ub09c \ud68c\uc0ac\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub358 \ub9cc\ub2e4\ub77c\ud2b8\ub97c \uc774\uc6a9\ud558\uc5ec \ud300\uc758 \ubaa9\ud45c\ub97c \uc815\ub9ac\ud558\uace0, OKR\uacfc \uc870\ud569\uc740 \uad1c\ucc2e\uc740 \uc870\ud569\uc774\ub77c\uace0 \uc0dd\uac01\ud55c\ub2e4.\\n\ud68c\uc0ac \ub9cc\ub2e4\ub77c\ud2b8\uac00 \uc874\uc7ac\ud558\uace0 \ub610 \uac01 \ud300\ubcc4\ub85c \ub9cc\ub2e4\ub77c\ud2b8 \uadf8\ub9ac\uace0 \uac01 \ud30c\ud2b8 \ud639\uc740 TF \ubcc4\ub85c \ub9cc\ub2e4\ub77c\ud2b8\uac00 \uc874\uc7ac\ud55c\ub2e4. \uadf8\ub9ac\uace0 \uac01 \uac04\ubcc4\ub85c \uc911\uc559\uc5d0\ub294 \ub3c4\uc804\uc801\uc778 Objective\ub97c \uc791\uc131\ud55c\ub2e4. \uadf8\ub9ac\uace0 \uadf8 \ub9cc\ub2e4\ub77c\ud2b8\ub294 \ud68c\uc0ac\ub098 \ud300 \uac01 \uc785\uc7a5\ucc28\uc774\uc5d0\uc11c Objective\uac00 \ub418\uae30\ub3c4\ud558\uace0 KR\uc774 \ub418\uae30\ub3c4 \ud55c\ub2e4. \uadf8\ub9ac\uace0 \ubcc4\ub3c4\uc758 \uc2dc\ud2b8\ub85c Initiative\uacfc KR\uc744 \uad00\ub9ac\ud55c\ub2e4. \ub098\ub97c \ud3ec\ud568\ud55c \ud68c\uc0ac\uc640 \ud300\uc758 \ubaa9\ud45c\ub97c \uc5bc\ub77c\uc778\ud558\uace0 \ubaa9\ud45c\ub97c \ub2ec\uc131\ud558\uae30 \uc704\ud55c \ubc29\ubc95\uc740 \uc88b\uc740 \uc2dc\ub3c4\ub77c\uace0 \uc0dd\uac01\ud55c\ub2e4.\\n\\n> \uc774\ub54c \ub098\ub294 \ud3c9\uc18c 22\uc2dc\uc5d0 \ucde8\uce68\ud558\uace0 04\uc2dc\uc815\ub3c4\uc5d0 \uae30\uc0c1\ud558\ub294\ub370 \uc774\ub7ec\ud55c \ud750\ub984\uc774 \ub9dd\uac00\uc838\uc11c \ub098\uc758 \uc815\uc2e0\uacfc \ubab8\uc774 \ub9dd\uac00\uc838\uac00\ub294 \ub290\ub08c\uc774 \ub4e4\uc5c8\ub2e4. \ub298 \uc790\uc815\uc5d0 \uac00\uae4c\uc6b4 \ud1f4\uadfc\uacfc \uc815\uc2dc \ucd9c\uadfc\uc740 \ud83d\ude25\\n\\n\ud558\uc9c0\ub9cc \uacc4\ud68d\uc744 \uce58\ubc00\ud558\uac8c \uc900\ube44\ud558\uace0 \uc2e4\ud589\ud558\ub294\uac83\uc740 \uc88b\uc740\uac83\uc774\uc9c0\ub9cc \uadf8\ub9cc\ud07c \uc2e4\ud589\ud560 \ub54c \ubb34\uac8c\uac00 \ubb34\uac70\uc6cc \uc9c0\ub294\uac83\uc740 \uc88b\uc9c0 \uc54a\ub2e4\uace0 \uc0dd\uac01\ud55c\ub2e4. \uc608\ub97c \ub4e4\uba74 \uac1c\ubc1c\uc744 \uc9c4\ud589\ud558\ub2e4\ubcf4\uba74 \ucef4\ud3ec\ub10c\ud2b8\ub97c \ud558\ub098\ub97c \ub9cc\ub4e4\ub2e4 \ubcf4\uba74 \ucc98\uc74c\uc5d0 \uc0dd\uac01\ud588\ub358 \ubaa9\ud45c\uc640\ub294 \ub2e4\ub974\uac8c \ub418\ub294 \uacbd\uc6b0\uac00 \ub9ce\ub2e4. \uadf8\ub9ac\uace0 \uadf8\uac83\uc744 \uc218\uc815\ud558\uace0 \ub2e4\uc2dc \uc218\uc815\ud558\uace0 \ub2e4\uc2dc \uc218\uc815\ud558\ub2e4\ubcf4\uba74 \ubaa9\ud45c\ub97c \ub2ec\uc131\ud558\ub294\ub370 \uc2dc\uac04\uc774 \ub9ce\uc774 \uc18c\uc694\ub41c\ub2e4. \ub9cc\ub2e4\ub77c\ud2b8\uc640 OKR\uc744 \uc791\uc131\ud558\uba74\uc11c \uadf8\ub3d9\uc548 \uce58\ubc00\ud558\uac8c \uacc4\ud68d\ud588\ub358 \ubd80\ubd84\uc744 \ubc29\ud5a5\uc774 \ubc14\ub014 \uc218 \uc788\ub294 \ubd80\ubd84\uc5d0 \ub300\ud574\uc11c \uc218\uc815\ud558\uac70\ub098 \ubcc0\uacbd\ud574\uc57c\ud558\ub294 \ubd80\ubd84\uc5d0 \ub300\ud574\uc11c\ub3c4 \ube60\ub974\uac8c \ub300\uc751\ud560 \uc218 \uc788\ub294 \ubc29\ubc95\uc744 \uace0\ubbfc\ud574\uc57c \ud558\uc9c0\uc54a\uc744\uae4c...?\\n\\n> Note: \ub9cc\ub2e4\ub77c\ud2b8\ub294 \uc774\uc804 \uc57c\uad6c \ud504\ub9ac\ubbf8\uc5b412 2015\ub97c \uc77c\ubcf8\uacfc \ud55c\uad6d \uacbd\uae30\ub97c \ubcf4\uba74\uc11c \uc624\ud0c0\ub2c8\uc1fc\ud5e4\uc774 \ubcf4\uba74\uc11c \uc54c\uac8c\ub41c \uc120\uc218\uc600\ub294\ub370 \uc120\ubc1c\ud22c\uc218\ub85c 160km\ub97c \ub358\uc9c0\uba70 \uc6b0\ub9ac\ub098\ub77c \uc120\uc218\ub294 1\ub8e8\ud0c0 \uc870\ucc28\ub85c \ucd9c\ubc1c\ud558\uc9c0 \ubabb\ud558\ub294\uac83\uc744 \ucda9\uaca9\uc740 \uc544\uc9c1\ub3c4 \uc78a\ud600\uc9c0\uc9c0 \uc54a\ub294\ub2e4. \uadf8\ub798\ub3c4 8\ud68c\uc640 9\ud68c\uc5d0 \uae30\ud68c\uac00 \uc0dd\uaca8 \ub300\ud55c\ubbfc\uad6d\uc758 \uc2b9\ub9ac\ub97c \uc774\ub04c\uac8c\ub418\uc5c8\ub294\ub370 \uc624\ud0c0\ub2c8\uc758 \ucda9\uaca9\uc774 \uc6cc\ub099\ucee4\uc11c \ud504\ub9ac\ubbf8\uc5b412\uc758 \uacb0\uc2b9\uc804\uc740 \ubcf4\uae34\ud558\uc600\uc9c0\ub9cc \uae30\uc5b5\uc774 \uc798 \ub098\uc9c0 \uc54a\ub294\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \uc624\ud0c0\ub2c8\uc758 \ubaa9\ud45c\ub97c \uc774\ub8e8\ub294\ub370 \ub9cc\ub2e4\ub77c\ud2b8\ub97c \uc0ac\uc6a9\ud558\uace0 \ud68c\uc0ac\uc5d0\uc11c\ub3c4 \uc801\uadf9\uc801\uc73c\ub85c \ub9cc\ub2e4\ub77c\ud2b8\ub97c \uc0ac\uc6a9\ud558\ub294\uac83\uc744 \ubcf4\uace0 \ub098\ub3c4 \ub9cc\ub2e4\ub77c\ud2b8\ub97c \uc544\ub798\uc640 \uac19\uc774 \uc815\ub9ac \ud558\uac8c \ub418\uc5c8\ub2e4. \uc774\ud6c4 \uc5b4\ub290\uc815\ub3c4 \uc644\uc131\uc774 \ub41c\ub2e4\uba74 \ube14\ub85c\uadf8\uc5d0\uc11c\ub3c4 \uc81c\ub300\ub85c \uad00\ub9ac\ud558\ub294 \ud615\ud0dc\ub85c \uace0\ubbfc \ud574\ubcfc\uae4c\ud55c\ub2e4.\\n\\n![Mandalart](./Mandalart.png)\\n\\n\ub610\ud55c \ub2e4\uc591\ud55c \uac1c\ubc1c\uc11c\uc801\uacfc \ucde8\ubbf8 \uc0bc\uc544 \uc77d\uace0 \uc788\ub294 \ub3c4\uc11c\ub4e4 \uadf8\ub9ac\uace0 \uacf5\ubd80\ud558\uac70\ub098 \ud68c\uc0ac \uc5c5\ubb34\ub85c \ubc1c\uc0dd\ud558\ub294 \ud2b8\ub7ec\ube14 \uc288\ud305\uc774\ub098 \ud574\uacb0\ubc29\ubc95\uc744 \uc815\ub9ac\ud558\uace0\uc790 \ud55c\ub2e4. \ub610\ud55c \ub0b4\uac00 \uace0\ubbfc \uc911\uc778 \uac83\ub4e4... \uae30\ud0c0 \ub4f1\ub4f1...\\n\\n\uc774\ud6c4\uc5d0\ub294 \ube14\ub85c\uadf8\ub97c \ud1b5\ud574 \uacf5\uc720\ud558\uace0\uc790 \ud55c\ub2e4."}]}}')}}]);